import React from 'react';
import './App.css';
import logo from './logo.png';

function App () {
  return(
    <div style={{ height: '2000px' }}>
       <header>
        <div className="bg-black h-80">
          <nav className='lg:flex hidden mx-auto max-w-7xl items-center bg-white py-2 rounded-md mt-1 ring-1 justify-between px-6'>
          <div class="flex lg:flex-1">
              <a href="/" class="-m-1.5 p-1.5">
                  <span class="sr-only">Your Company</span>
                  <img src={logo} className="h-16 w-auto" alt="logo" />
              </a>
          </div>
          </nav>
        </div>
      </header>  
      <div>
        <p>lets see what is good here</p>
      </div>
      </div>
  );
}

export default App;
